<script>
	import { onMount } from 'svelte';
	import { createEventDispatcher } from 'svelte';

	const dispatch = createEventDispatcher();

	export let customizationChoices;
	export let step;
	export let focused;

	let defaultPhoto;

	let svg;
	
	// split description into three lines
	let top = '';
	let middle = '';
	let bottom = '';

	let arr = [];
	let placedCharacters = 0;
	let word;
	let wordLength;

	$: {
		if (customizationChoices.description) {
			top = '';
			middle = '';
			bottom = '';
			placedCharacters = 0;

			arr = customizationChoices.description.split(' ');
			let newArr = [];

			// split long words
			for (let h=0; h<arr.length; h++) {
				if (arr[h].length > 15) {
					let subStr = arr[h].slice(15);
					let rootStr = arr[h].split(subStr)[0] + '-';

					if (subStr.length > 15) {
						let subSubStr = subStr.slice(15);
						let rootSubStr = subStr.split(subSubStr)[0] + '-';

						newArr.push(rootStr);
						newArr.push(rootSubStr);
						newArr.push(subSubStr);
					} else {
						newArr.push(rootStr);
						newArr.push(subStr);
					}
				} else {
					newArr.push(arr[h]);
				}
			}

			// ensure vertical centering when placing words
			for (let i=0; i<newArr.length; i++) {
				word = ` ${newArr[i]}`;
				wordLength = word.length;

				if (placedCharacters > 50 || placedCharacters + wordLength > 50) {
					if (bottom !== '') {
						if (bottom.length + wordLength > 50) {
							middle = bottom;
							bottom = word;
						} else {
							bottom += word;
						}
					} else {
						if (top.length == 0) {
							top = middle;
							middle = '';
							bottom = word;
						} else {
							middle += word;
						}
					}
				} else {
					middle += word;
				}

				placedCharacters += wordLength;
			}
		} else {
			top = '';
			middle = '';
			bottom = '';
		}
	}

	async function processDefaultPhoto() {
		let blob = await fetch("/images/Example Flyer Photo.jpg").then(r => r.blob());
    	defaultPhoto = await new Promise(resolve => {
      		let reader = new FileReader();
      		reader.onload = () => resolve(reader.result);
     		reader.readAsDataURL(blob);
    	});
	}

	$: {
		dispatch('document-updated', {
			svg: svg
		});
	}

	onMount(() => {
		processDefaultPhoto();

		dispatch('document-updated', {
			svg: svg
		});
	})
</script>

